"""
@author : zenithude

Permutation in String

Given two strings s1 and s2, write a function to return true if s2 contains
the permutation of s1. In other words, one of the first string's
permutations is the substring of the second string.



Example 1:

Input: s1 = "ab" s2 = "eidbaooo"
Output: True
Explanation: s2 contains one permutation of s1 ("ba").

Example 2:

Input:s1= "ab" s2 = "eidboaoo"
Output: False



Note:

    The input strings only contain lower case letters.
    The length of both given strings is in range [1, 10,000].


"""
from itertools import permutations


class Solution1:
    def checkInclusion(self, s1, s2):
        """
        solution trop simple pas assez rapide
        :param s1: str
        :param s2: str
        :return: bool
        """

        if len(s1) > len(s2):
            return False

        if len(s1) == 1 and s1[0] in s2:
            return True

        permList = permutations(s1)
        for perm in list(permList):
            if ''.join(perm) in s2:
                return True
        return False


def changeStringToListInt(string):
    """

    :param string: str
    :return: List[int]
    """
    SList = []
    for element in string:
        SList.append(ord(element))
    return SList


class Solution():
    def checkInclusion(self, s1, s2):
        """
        solution trop lente avec s5 et s6
        :param s1: str
        :param s2: str
        :return: bool
        """
        if len(s1) > len(s2):
            return False

        if len(s1) == 1 and s1[0] in s2:
            return True

        SL1 = changeStringToListInt(s1)
        SL1.sort()
        SL2 = changeStringToListInt(s2)

        for i in range(len(SL2) - len(SL1)):

            if sorted(SL2[i:i + len(SL1)]) == SL1:
                return True

        return False


obj = Solution()
s1 = "trinitrophenylmethylnitramine"
s2 = "dinitrophenylhydrazinetrinitrophenylmethylnitramine"

s3 = "abc"
s4 = "ccccbbbbaaaa"

s5 = " "
s6 = ""
print(obj.checkInclusion(s5, s6))
